mapper.select:
select 

from CLINIC_MASTER
where VISIT_DATE = #{visitDate,jdbcType=TIMESTAMP}
  and VISIT_NO = #{visitNo,jdbcType=NUMERIC}

select

from CLINIC_MASTER c


    and c.VISIT_DATE = TO_DATE(#{visitDate,jdbcType=TIMESTAMP}, 'YYYY-MM-DD')


    and c.VISIT_NO = #{visitNo,jdbcType=NUMERIC}


    and c.PATIENT_ID = #{patientId,jdbcType=VARCHAR}

mapper.delete:
delete from CLINIC_MASTER
where VISIT_DATE = #{visitDate,jdbcType=TIMESTAMP}
  and VISIT_NO = #{visitNo,jdbcType=NUMERIC}
